selector_to_html = {"a[href=\"registration_tutorial.html#types-of-registration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Types of Registration<a class=\"headerlink\" href=\"#types-of-registration\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Image_registration\">Image registration</a> can often improve the quality of cellular traces obtained during the later segmentation step.</p><p>The motion artifacts present in a 3D timeseries come in two flavors, <code class=\"docutils literal notranslate\"><span class=\"pre\">rigid</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">non-rigid</span></code>.</p>", "a[href=\"segmentation_tutorial.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Explained: Source Extraction<a class=\"headerlink\" href=\"#explained-source-extraction\" title=\"Permalink to this heading\">#</a></h1><p>This section details background information helpful with <a class=\"reference internal\" href=\"../user_guide/segmentation.html#ug-source-extraction\"><span class=\"std std-ref\">Step 3: Segmentation</span></a></p><p>Source extraction is the umbrella term for a sequence of steps designed to distinguish neurons from background signal calculate the properties and characteristics of these neurons relative to the background.</p>", "a[href=\"axial_correction_tutorial.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Explained: Axial Offset Correction<a class=\"headerlink\" href=\"#explained-axial-offset-correction\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">3.1. </span>Background<a class=\"headerlink\" href=\"#background\" title=\"Permalink to this heading\">#</a></h2><p>Light beads traveling to our sample need to be temporally distinct relative to our sensor\nso that the aquisition system knows the origin and subsequent depth of each bead.</p><p>The current LBM design incoorperates 2 cavities, hereby named <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">A</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">B</span></code>.\nThese two cavities are non-overlapping areas where light beads travel. If we plot\na sample pollen grain through each z-depth, we can see these cavities manifest:</p>", "a[href=\"#tutorials\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Tutorials<a class=\"headerlink\" href=\"#tutorials\" title=\"Permalink to this heading\">#</a></h1><p>This section coveres theory underlying pipeline processes.</p>", "a[href=\"segmentation_tutorial.html#deconvolution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Deconvolution<a class=\"headerlink\" href=\"#deconvolution\" title=\"Permalink to this heading\">#</a></h2><p>The CNMF output yields \u201craw\u201d traces, we need to deconvolve these to convert these raw traces to interpritable neuronal traces.</p><p>These raw traces are noisy, jagged, and must be denoised, detrended and deconvolved.</p>", "a[href=\"segmentation_tutorial.html#constrained-non-negative-matrix-factorization-cnmf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.1. </span>Constrained Non-Negative Matrix Factorization (CNMF)<a class=\"headerlink\" href=\"#constrained-non-negative-matrix-factorization-cnmf\" title=\"Permalink to this heading\">#</a></h2><p>At a high-level, the <a class=\"reference internal\" href=\"../glossary.html#term-CNMF\"><span class=\"xref std std-term\">CNMF</span></a> algorithm works by:</p>", "a[href=\"axial_correction_tutorial.html#background\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.1. </span>Background<a class=\"headerlink\" href=\"#background\" title=\"Permalink to this heading\">#</a></h2><p>Light beads traveling to our sample need to be temporally distinct relative to our sensor\nso that the aquisition system knows the origin and subsequent depth of each bead.</p><p>The current LBM design incoorperates 2 cavities, hereby named <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">A</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">Cavity</span> <span class=\"pre\">B</span></code>.\nThese two cavities are non-overlapping areas where light beads travel. If we plot\na sample pollen grain through each z-depth, we can see these cavities manifest:</p>", "a[href=\"segmentation_tutorial.html#validating-neurons-and-traces\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.3. </span>Validating Neurons and Traces<a class=\"headerlink\" href=\"#validating-neurons-and-traces\" title=\"Permalink to this heading\">#</a></h2><p>The key idea for validating our neurons is that <strong>we know how long the\nbrightness indicating neurons activity should stay bright</strong> as a function\nof the <em>number of frames</em>.</p><p>That is, our calcium indicator (in this example: GCaMP-6s):</p>", "a[href=\"registration_tutorial.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Explained: Registration<a class=\"headerlink\" href=\"#explained-registration\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">1.1. </span>Types of Registration<a class=\"headerlink\" href=\"#types-of-registration\" title=\"Permalink to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Image_registration\">Image registration</a> can often improve the quality of cellular traces obtained during the later segmentation step.</p><p>The motion artifacts present in a 3D timeseries come in two flavors, <code class=\"docutils literal notranslate\"><span class=\"pre\">rigid</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">non-rigid</span></code>.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
